DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS ratings;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS users;
CREATE TABLE movies(
	id integer primary key,
	title text,
	year integer,
	genres text
);
CREATE TABLE ratings(
	id integer primary key,
	user_id integer,
	movie_id integer,
	rating real,
	timestamp integer
);
CREATE TABLE tags(
	user_id integer,
	movie_id integer,
	tag text,
	timestamp integer
);
CREATE TABLE users(
	id integer primary key,
	name text,
	email text,
	gender text,
	register_date text,
	occupation text
);

