PRAGMA foreign_keys = OFF;

CREATE TABLE IF NOT EXISTS genres(
	id integer primary key AUTOINCREMENT,
	genre text
);

CREATE TABLE IF NOT EXISTS temp_movies(
	id integer primary key AUTOINCREMENT,
	year integer default null,
	title text not null
);

CREATE TABLE IF NOT EXISTS genres_movies(
	id integer primary key AUTOINCREMENT,
	genre_id integer not null,
	movie_id integer not null,
	foreign key(genre_id) references genres(id) on delete cascade,
	foreign key (movie_id) references movies(id) on delete cascade
);

CREATE TABLE IF NOT EXISTS occupations
(
    id integer primary key AUTOINCREMENT,
    title text not null 
);

CREATE TABLE IF NOT EXISTS temp_users(
	id integer primary key AUTOINCREMENT,
	name text not null,
	lastname text not null,
	email text not null unique,
	gender text not null check(gender == "male" or gender == "female"),
	register_date text not null,
	occupation_id integer not null,
	foreign key(occupation_id) references occupations(id) on delete cascade
);

CREATE TABLE IF NOT EXISTS temp_ratings(
	id integer primary key AUTOINCREMENT,
	user_id integer not null,
	movie_id integer not null,
	rating real not null check(rating >= 0.0 and rating <= 5.0),
	timestamp integer not null,
	foreign key (user_id) references users(id) on delete cascade,
	foreign key (movie_id) references movies(id) on delete restrict
);

CREATE TABLE IF NOT EXISTS temp_tags(
	id integer primary key AUTOINCREMENT,
	user_id integer not null,
	movie_id integer not null,
	tag text not null,
	timestamp integer not null,
	foreign key (user_id) references users(id) on delete cascade,
	foreign key (movie_id) references movies(id) on delete cascade
);

---- genres
select g.genre from (with t(genre, rest) as( select null, genres from movies union all 
select case when instr(rest,'|') = 0 then rest else substr(rest,1,instr(rest,'|')-1) end, 
case when instr(rest,'|')=0 then null else substr(rest,instr(rest,'|')+1) end 
from t where rest is not null) 
select genre from t where genre is not null group by genre) as g;

