insert or ignore into temp_users(name, lastname, email, register_date, gender, occupation_id)
select substr(u.name, 0, instr(u.name, ' ')), substr(u.name, instr(u.name, ' ') + 1), u.email, u.register_date, u.gender, o.id
from users as u inner join occupations as o on o.title == u.occupation;

